import Button from "react-bootstrap/Button"

function App() {
  return (
    <>
    <div className="row mx-0">
      <div className="col-12 d-flex py-5 my-4 justify-content-center">
        <img src="img/home-page-test.png" width="750px"/>
      </div>
    </div>
    <div className="d-flex justify-content-center">
      <Button className="" ><img src="img/star-spinning.gif" width="175px"/></Button>
    </div>
